	note.textContent = text;
	note.setAttributeNS(null, "visibility", "visible");
	document.getElementById(pos + "_overlay_3e3d2b67").setAttributeNS(null, "visibility", "visible");
}
function hide_3e3d2b67(evt) {
	document.getElementById("top_note_3e3d2b67").setAttributeNS(null, "visibility", "hidden");
